import React, {useState} from 'react';
import './App.css';
import { BrowserRouter as Router} from 'react-router-dom';
import {Home} from './Pages/index'
function App(){
  return (
    <Router>
      <Switch>
        <Route path='/' component={Home} exact />
      </Switch>
      </Router>

  );
}

export default App;
